import {React , useState}from "react";

import Estilo from "../Hojas de Estilos/BotonMenu.css"
function BotonMenu () {
    const [activo, setActivo] = useState(false);
    const cambiarActivo = ()=>{
        setActivo(!activo)
    }
    return(
        <div className={activo? "boton-menu activo" : "boton-menu" } onClick={cambiarActivo}>
            <div className="linea linea-top"></div>
            <div className="linea linea-mid"></div>
            <div className="linea linea-bot"></div>
        </div>
    );
};

export default BotonMenu;
